WATCH JOYLAND IN THEATRES. It is a HISTORIC film and must-see cinema. It’s opening weekend in LA so spend your Sunday, your Eid weekend, at the movies. I had the pleasure of hosting a Q&A with writer/director @saim.sadiq & producer @apoorvagc and producer @laurenmann36 at the @landmarktheatres on Friday night. It is essential to see this film — artistically, it’s brilliant and just as a human person who cares about stories you should watch it — and if you can’t go in person buy a ticket for someone else or buy a bunch of tickets even if you can’t attend to support! This film is a stunning portrayal of the harm the patriarchy has on all of us. You will cry, laugh, and be blown away by the performances. 

